import './footer.css';
import { Container, Row, Col, ListGroup, ListGroupItem } from 'reactstrap';
import { Link } from 'react-router-dom';
import logo from '../../assets/images/logo.png';

const Footer = () => {

  const quick_links = [
    {
        path:'/home',
        display:'Home'
    },
     {
        path:'/about',
        display:'About'
    },
     {
        path:'/tours',
        display:'Tours'
    },
]

const quick_links2 = [
    {
        path:'/',
        display:'Home'
    },
     {
        path:'/about',
        display:'About'
    },
     {
        path:'/tours',
        display:'Tours'
    },
]

  return (
    <footer className='footer'>
      <Container>
        <Row>
          <Col lg='3'>
          </Col>
        </Row>
      </Container>
    </footer>
  )
}

export default Footer
